css:
/*
* This is sortof prepared for adjustable themes.
* Everything is based of a single color taken from the syntax theme.
*/
.linter-summary .icon-right {
  visibility: visible;
}
.linter-summary .icon-right:before {
  font-family: 'Octicons Regular';
  opacity: 0.6;
  content: "\f052";
  font-size: 1.1em;
  padding: 0 .1em;
  margin-right: .3em;
}
.linter-summary .linter-info .icon-right:before {
  color: #3368ca;
}
.linter-summary .linter-warning .icon-right:before {
  color: #bf9555;
}
.linter-summary .linter-error .icon-right:before {
  color: #d73a1e;
}
